#[cfg_attr(not(feature = "library"), entry_point)]
pub fn execute(
	deps: DepsMut,
	env: Env,
	_info: MessageInfo,
	msg: ExecuteMsg,
) -> Result<Response, ContractError> {
	let client = GrandpaClient::<HostFunctions>::default();
	let ctx = Context::<HostFunctions>::new(deps, env);
	let client_id = ClientId::from_str("unnamed_client").unwrap();
	let result = process_message(msg, client, ctx, client_id);
	let data = match result {
		Ok(res) => res,
		Err(ContractError::Grandpa(e)) => to_binary(&ContractResult::error(e))?,
		Err(e) => return Err(e),
	};
	let mut response = Response::default();
	response.data = Some(data);
	Ok(response)
}

fn process_message(
	msg: ExecuteMsg,
	client: GrandpaClient<HostFunctions>,
	ctx: Context<HostFunctions>,
	client_id: ClientId,
) -> Result<Binary, ContractError> {
	let result = match msg {
		ExecuteMsg::ValidateMsg(_) => todo!(),
		ExecuteMsg::StatusMsg(_) => todo!(),
		ExecuteMsg::ExportedMetadataMsg(_) => todo!(),
		ExecuteMsg::ZeroCustomFieldsMsg(_) => todo!(),
		ExecuteMsg::GetTimestampAtHeightMsg(_) => todo!(),
		ExecuteMsg::InitializeMsg(_) => todo!(),
		ExecuteMsg::VerifyMembershipMsg(msg) => {
			let msg = VerifyMembershipMsg::try_from(msg)?;
			verify_membership::<BlakeTwo256, _>(
				&msg.prefix,
				&msg.proof,
				&msg.root,
				msg.path,
				msg.value,
			)
			.map_err(|e| ContractError::Grandpa(e.to_string()))
			.map(|_| to_binary(&ContractResult::success()))
		},
		ExecuteMsg::VerifyNonMembershipMsg(msg) => {
			let msg = VerifyNonMembershipMsg::try_from(msg)?;
			verify_non_membership::<BlakeTwo256, _>(&msg.prefix, &msg.proof, &msg.root, msg.path)
				.map_err(|e| ContractError::Grandpa(e.to_string()))
				.map(|_| to_binary(&ContractResult::success()))
		},
		ExecuteMsg::VerifyClientMessage(msg) => {
			let msg = VerifyClientMessage::try_from(msg)?;
			client
				.verify_client_message(&ctx, client_id, msg.client_state, msg.client_message)
				.map_err(|e| ContractError::Grandpa(e.to_string()))
				.map(|_| to_binary(&ContractResult::success()))
		},
		ExecuteMsg::CheckForMisbehaviourMsg(msg) => {
			let msg = CheckForMisbehaviourMsg::try_from(msg)?;
			client
				.check_for_misbehaviour(&ctx, client_id, msg.client_state, msg.client_message)
				.map_err(|e| ContractError::Grandpa(e.to_string()))
				.map(|_| to_binary(&ContractResult::success()))
		},
		ExecuteMsg::UpdateStateOnMisbehaviourMsg(msg) => {
			let msg = UpdateStateOnMisbehaviourMsg::try_from(msg)?;
			client
				.update_state_on_misbehaviour(msg.client_state, msg.client_message)
				.map_err(|e| ContractError::Grandpa(e.to_string()))
				.map(|_| to_binary(&ContractResult::success()))
		},
		ExecuteMsg::UpdateState(msg_raw) => {
			let mut client_state: WasmClientState = msg_raw.client_state.clone();
			let msg = UpdateStateMsg::try_from(msg_raw)?;
			client
				.update_state(&ctx, client_id, msg.client_state, msg.client_message)
				.map_err(|e| ContractError::Grandpa(e.to_string()))
				.map(|(cs, cu)| {
					client_state.latest_height = cs.latest_height().into();
					client_state.data = RawClientState::from(cs).encode_to_vec();
					match cu {
						ConsensusUpdateResult::Single(cs) => {
							// let wasm_cs = WasmConsensusState::from(cs);
						},
						ConsensusUpdateResult::Batch(cs) => {},
					}
					to_binary(&client_state)
						.and_then(|data| to_binary(&ContractResult::success().data(data.0)))
				})
		},
		ExecuteMsg::CheckSubstituteAndUpdateStateMsg(_msg) => {
			todo!("check substitute and update state")
		},
		ExecuteMsg::VerifyUpgradeAndUpdateStateMsg(msg) => {
			let msg = VerifyUpgradeAndUpdateStateMsg::try_from(msg)?;
			client
				.verify_upgrade_and_update_state(
					&ctx,
					client_id,
					&msg.old_client_state,
					&msg.upgrade_client_state,
					&msg.upgrade_consensus_state,
					msg.proof_upgrade_client,
					msg.proof_upgrade_consensus_state,
				)
				.map_err(|e| ContractError::Grandpa(e.to_string()))
				.map(|_| to_binary(&ContractResult::success()))
		},
		ExecuteMsg::InitializeState(InitializeState { me, consensus_state }) => {
			let state_call_response = ClientStateCallResponse {
				me: me.clone(),
				new_consensus_state: consensus_state.clone(),
				new_client_state: me.clone(),
				result: ContractResult::success(),
			};
			let response = to_binary(&state_call_response);
			Ok(response)
		},
		ExecuteMsg::ClientCreateRequest(_) => Ok(to_binary(&ContractResult::success())),
	};
	Ok(result??)
}

